import React from 'react'
import franklin from '../images/franklin.jpeg'; 
import '../index.css';

export default function Nav() {
    return (
        <div>
            <img className="franklin" src={franklin} />
            <ul>
                <li>SPORTS</li>
                <li>FAMILY GAMES</li>
                <li>FAN SHOP</li>
                <li>SALE</li>
                <li>GIFT CARDS</li>
                <li>CUSTOM BATTING GLOVES</li>
            </ul>
        </div>
    )
}
